import React from "react";
import { Typewriter } from 'react-simple-typewriter';
const Hero_textdes = () => {
  return (
    <div className="herosection" id="home">
      <h3>Hii i'm</h3>
      <h2>Nitin Chakrawarti</h2>
      <span>
        <h2>& I'm</h2>
      </span>
      <span>


      <Typewriter
      className="typrwriter"
            words={['Frontend developer','React Developer', 'UI,UX']}
            loop={5}
            cursor
            cursorStyle='|'
            typeSpeed={60}
            deleteSpeed={50}
            delaySpeed={1000}
          />
       
      </span>
    </div>
  );
};

export default Hero_textdes;
